import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';


import { ProductProvider } from './compenents/ProductContext';
import { BrowserRouter as Router } from 'react-router-dom';



ReactDOM.render(
  <Router>
    <ProductProvider>
      <App />
    </ProductProvider>
  </Router>,
  document.getElementById('root')
);
